    public RawResponse swapFace(String imageBase64, String templateBase64) throws Exception {
        Map<String, String> queryMap = new HashMap<>();
        Map<String, String> requestMap = new HashMap<>();
        requestMap.put("image_base64", imageBase64);
        requestMap.put("template_base64", templateBase64);
        requestMap.put("action_id", "faceswap");
        requestMap.put("version", "1.0");

        RawResponse response = post(ImageConst.FaceSwap, Utils.mapToPairList(queryMap), Utils.mapToPairList(requestMap));
        if (response.getCode() != SdkError.SUCCESS.getNumber()) {
            throw response.getException();
        }
        return response;
    }

    public String swapFaceBase64(String imageBase64, String templateBase64) throws Exception {
        RawResponse resp = swapFace(imageBase64, templateBase64);
        String result = new String(resp.getData());
        log.info("huoshan api result : " + result);
        return JSONObject.parseObject(result).getJSONObject("data").getString("image");
    }

    public String swapFaceBase64(InputStream imageInput, InputStream templateInput) throws Exception {
        return swapFaceBase64(ObjectUtil.getBase64FromInputStream(imageInput), ObjectUtil.getBase64FromInputStream(templateInput));
    }

    public void swapFaceFile(String filePath, String imageBase64, String templateBase64) throws Exception {
        FileUtil.saveFromBase64String(filePath, swapFaceBase64(imageBase64, templateBase64));
    }

    public void swapFaceFile(String filePath, InputStream imageInput, InputStream templateInput) throws Exception {
        FileUtil.saveFromBase64String(filePath, swapFaceBase64(imageInput, templateInput));
    }


